 05 TYPE(DATAOUT) INTENS(HIGH) COLOR(RED)
 06 TYPE(DATAOUT) INTENS(HIGH) COLOR(TURQUOISE)
 07 TYPE(DATAOUT) INTENS(HIGH) COLOR(BLUE)
)BODY WIDTH(&ZSCREENW) EXPAND(//)
%COMMAND ===>_ZCMD                                            %SCROLL ===>_VSCR+
@PMSG1
@PMSG2
@PMSG3
@PMSG4
@PMSG5
%                                   DSCBs on $PVOLSER
|VDATA ---------------------------------/ /------------------------------------|
|                                       / /                                    |
| --------------------------------------/-/------------------------------------|
)INIT
)REINIT
  REFRESH(ZCMD,VSCR,VDATA,PMSG1,PMSG2,PMSG3,PMSG4,PMSG5,ZPFKEY,PVOLSER)
)PROC
  &VVDEPTH = LVLINE(VDATA)
)END

